eval("module.exports = \"<h1>Comparison to other React static site generators</h1>\\n<h3><a href=\\\"https://github.com/gatsbyjs/gatsby/\\\">Gatsby</a></h3>\\n<p>Similar to Nucleate, Gatsby offers:</p>\\n<ul>\\n<li>Creation of pages as React components, using ES2015+ via <a href=\\\"https://babeljs.io/\\\">Babel</a></li>\\n<li>Creation of pages as Markdown documents</li>\\n<li>Declarative, directory-based routes</li>\\n<li>Instant client-side route transitions</li>\\n<li>Live reloading during development as you edit code</li>\\n</ul>\\n<p>In addition, Gatsby also offers:</p>\\n<ul>\\n<li>\\n<p>Hot module replacement via <a href=\\\"https://github.com/gaearon/react-transform-hmr\\\">react-transform-hmr</a></p>\\n<p><em>Note: I chose not to add HMR to Nucleate yet due to being unable to hot reload Markdown pages (due to <a href=\\\"https://medium.com/@dan_abramov/hot-reloading-in-react-1140438583bf\\\">issues described here by @gaearon </a>), and due to conflicts with Nucleate's server rendering. When react-hot-loader@3 is released and <a href=\\\"https://github.com/reactjs/react-router/issues/2182\\\">react-router#2182</a> is resolved, I'll reconsider HMR.</em></p>\\n</li>\\n<li>\\n<p>The <code>gatsby new</code> command to create a new site from a template</p>\\n</li>\\n</ul>\\n<p>However, Gatsby some drawbacks:</p>\\n<ul>\\n<li><a href=\\\"https://github.com/gatsbyjs/gatsby/blob/ab9736676b030b148032a4e6b66b377ee34ee094/README.md#structure-of-a-gatsby-site\\\">Complex, opinionated configuration and folder structure</a>: <code>config.toml</code>, <code>html.js</code>, <code>/pages</code>, <code>_template.jsx</code>, etc.</li>\\n<li>No server rending during development: this poor <a href=\\\"http://12factor.net/dev-prod-parity\\\">dev/prod parity</a> can lead to different behaviour between the development site and the generated static site.</li>\\n</ul>\\n<h3><a href=\\\"https://phenomic.io/\\\">Phenomic</a> (previously <a href=\\\"http://moox.io/statinamic/\\\">Statinamic</a>)</h3>\\n<p>Coming soon.</p>\\n<h3><a href=\\\"https://sitegen.github.io/\\\">Sitegen</a></h3>\\n<p>Coming soon.</p>\\n\";//# sourceMappingURL=data:application/json;charset=utf-8;base64,");

